import 'bootstrap/dist/css/bootstrap.css';
import { Container, Row, Col, Card, CardHeader, CardBody } from 'reactstrap';
import TablaContenido from './components/TablaContenido';
const App = () => {
    return (
        <Container>
            <Row className="mt-5">
                <Col sm="12">
                    <Card>
                        <CardHeader>
                            <h5>Bla</h5>
                        </CardHeader>
                        <CardBody>
                            <Button size="sm" color="success">Nuevo</Button>
                            <hr></hr>
                            <TablaContenido/>
                        </CardBody>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
}
export default App;
